  \"DWNT/Hydrogenated Fullerene Reinforced Polyethylene for Radiation Shielding Applications
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T22:07:19.680797\",\n\t\"name\":
  \"dwnt-hydrogenated-fullerene-reinforced-polyethylene-for-radiation-shielding-applications-p\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Manned space exploration requires radiation
  protection, particularly since the impact of radiation on the health and safety
  of humans on extended missions is not known.  The best material candidates are those
  with high hydrogen contents and low molecular weight, and thus polymers are excellent
  choices. However, their thermal stability and mechanical properties need to be improved.
  \ MER proposes to achieve this using a combination of DWNT with hydrogenated fullerenes,
  where the latter can be deposited inside the prior, achieving the so-called \"peapod\"
  materials.  Developed composites will be characterized for mechanical performance
  and radiation hardness as a screening tool.  Selected composites of varying thickness
  and composition will be chosen for more comprehensive testing in Phase II.\",\n\t\"license_title\":
